import classes from "./NewPost.module.css"

function NewPost() {
    return (<div className={
        classes.newpost
    }>
        <form className={classes}>
            <label className={
                    classes.author
                }
                forHTML="author">Author</label><br/>
            <input id="author" type="text"></input><br/>
            <label className={
                    classes.book
                }
                forHTML="book">Book</label><br/>
            <textarea id="book"
                rows={3}></textarea>
        </form>
    </div>)
}
export default NewPost;
